import React from "react";
import FundInfo from "../components/Fund_Info";
import MarketValue from "../components/MarketValue";
import Price from "../components/Price";
import UnrealizedPAndL from "../components/UnrealizedPAndL";

function Dashboard() {
  return (
    <div>
      <Price />
      <FundInfo />
      <MarketValue />
      <UnrealizedPAndL/>
    </div>
  );
}

export default Dashboard;
